(27, 1, 'The best deals going live for Amazon’s Prime Early Access Sale', 'the-best-deals-going-live-for-amazons-prime-early-access-sale', 26, NULL, '<p>Prime members can start checking off their holiday gift lists with early deals, like 80% off select Fire TV smart TVs and other deep discounts across categories.</p>', '<div class=\"ArticlePage-subHeadline\">Prime members can start checking off their holiday gift lists with early deals, like 80% off select Fire TV smart TVs and other deep discounts across categories.</div>\r\n<div class=\"ArticlePage-articleBody articleBody\" data-bsp-plugin=\"Module17103\">\r\n<div class=\"RichTextArticleBody mood-color\">\r\n<div class=\"RichTextArticleBody-body\">\r\n<p>Amazon is offering a list of some of the top deals going live during the new&nbsp;<span class=\"Enhancement-inline\"><span class=\"Enhancement-item\"><a class=\"Link\" href=\"https://www.aboutamazon.com/news/retail/amazon-prime-early-access-sale-offers-top-deals\" data-cms-ai=\"0\">Prime Early Access Sale</a></span></span>. The two-day sale starts today and offers Prime members exclusive access to hundreds of thousands of early deals this holiday season.</p>\r\n<p>Deals are available on products across categories, including electronics from Samsung and Sony, popular home and kitchen products from Casper and Ninja, toys from Melissa &amp; Doug and Hasbro, beauty favorites from Drybar and Caudalie, and top fashion picks from Calvin Klein and Orolay jackets.</p>\r\n<p>As part of the event, Amazon is introducing a Top 100 Deals list of some of the season&rsquo;s most popular and giftable items, including Amazon devices and products from across beauty, electronics, fashion, home, pets, and toys. During the sales event, new deals will drop every 30 minutes during select periods&nbsp;<span class=\"Enhancement-inline\"><span class=\"Enhancement-item\"><a class=\"Link\" href=\"https://www.amazon.com/earlyaccess\" target=\"_blank\" rel=\"noopener\" data-cms-ai=\"0\">on Amazon</a></span></span>&nbsp;and on&nbsp;<span class=\"Enhancement-inline\"><span class=\"Enhancement-item\"><a class=\"Link\" href=\"https://www.amazon.com/b?ie=UTF8&amp;node=21430372011\" target=\"_blank\" rel=\"noopener\" data-cms-ai=\"0\">the Amazon shopping app</a></span></span>.</p>\r\n<h3 class=\"cms-headings-h3\">Check out some of the top deals</h3>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Save 80%</strong>&nbsp;on the Amazon Fire TV Omni Series 55-inch 4K Smart TV with hands-free Alexa and save 70% on Hisense 50-inch U6 Series 4K Quantum Dot QLED Fire TV</li>\r\n<li><strong>Save up to 55%</strong>&nbsp;on select Echo devices and Fire tablet bundles</li>\r\n<li><strong>Save up to 50%</strong>&nbsp;on select headphones, earbuds, and speakers from Bose, Sony, and JBL</li>\r\n<li><strong>Save up to 50%</strong>&nbsp;on select electric toothbrushes from Oral-B and Philips Sonicare</li>\r\n<li><strong>Save up to 50%&nbsp;</strong>on select Hasbro toys</li>\r\n<li><strong>Save up to 45%&nbsp;</strong>on select vacuums from Shark and iRobot</li>\r\n<li><strong>Save up to 40%&nbsp;</strong>on select power tools from brands like BLACK+DECKER, BOSCH, DEWALT, and GEARWRENCH</li>\r\n<li><strong>Save 40%</strong>&nbsp;on select products from Keurig</li>\r\n<li><strong>Save up to 40%</strong>&nbsp;on select Ninja products</li>\r\n<li><strong>Save up to 40%</strong>&nbsp;on select Vitamix blenders</li>\r\n<li><strong>Save up to 40%</strong>&nbsp;on select Barbie dolls</li>\r\n<li><strong>Save up to 35%</strong>&nbsp;on select laptops and accessories from Acer, Asus, Dell, HP, Lenovo, and LG</li>\r\n<li><strong>Save 30%&nbsp;</strong>on select LEGO sets</li>\r\n<li><strong>Save up to 30%</strong>&nbsp;on select hair products from Drybar, Living Proof, Olaplex, and R+Co</li>\r\n<li><strong>Save 30%</strong>&nbsp;on select lip masks and balms from LANEIGE</li>\r\n<li><strong>Save up to 30%</strong>&nbsp;on select Solo Stove fire pits and accessories</li>\r\n<li><strong>Save 30%</strong>&nbsp;on Casper pillows and mattress toppers</li>\r\n<li><strong>Save up to 30%</strong>&nbsp;on select Orolay coats including vests, trench coats, and down jackets</li>\r\n<li><strong>Save up to 30%</strong>&nbsp;on top shoes and apparel styles from New Balance</li>\r\n<li><strong>Save 15%&nbsp;</strong>on the Peloton Bike with delivery available to select locations and up to 25% on select accessories and apparel</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>', NULL, '1', '2022-10-11 11:56:57', '2022-10-11 11:56:57');

