(12, 'Philips 458471 Hue Smart Bridge on 12 % discount', 'philips-458471-hue-smart-bridge-on-discount', 'https://amzn.to/3KhezuV', '226', '16', '<h1 id=\"title\" class=\"a-size-large a-spacing-none\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\">Hue Smart Bridge (Compatible with Amazon Alexa, Apple HomeKit and Google Assistant), White Ambiance</span></h1>', '<table class=\"a-normal a-spacing-micro\" style=\"font-size: 14px;\">\r\n<tbody>\r\n<tr class=\"a-spacing-small po-brand\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Brand</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">PHILIPS</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-special_feature\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Special Feature</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Unlocks all Philips Hue Control Features</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-light_color\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Light Color</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">White</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-voltage\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Voltage</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">120 Volts</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-unit_count\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Unit Count</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">1.0 Count</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n<li><span class=\"a-list-item\">Voice activated: With the Philips Hue Smart Hub, add up to 50 Philips Hue smart lights of your choice with this ZigBee-controlled hub necessary for voice control with Alexa, Apple HomeKit, or Google Assistant</span></li>\r\n<li><span class=\"a-list-item\">Control your smart lights from anywhere: The heart of your Philips Hue system, this hue hub also enables you to control all of your Philips Hue products via the Philips Hue app, even when you\'re away from home</span></li>\r\n<li><span class=\"a-list-item\">Fully automate your smart home: Enhance your Philips Hue system by setting timers and alarms, connecting to a variety of apps, dimming the smart lights and more (cannot be used with conventional dimmers)</span></li>\r\n<li><span class=\"a-list-item\">Expand your ecosystem: Easily expand your smart lighting system with Philips Hue accessories (sold separately), such as a Hue Dimmer Switch, Hue Tap, or Hue Motion Sensor. Pair it for home automation with your existing Nest or SmartThings system. Control your hue lights by connecting the Hue Hub to your router with the included ethernet network cable. This box also includes one Philips Hue Hub, power adapter, manual, and two-year warranty for the full Philips Hue experience.</span></li>\r\n<li><span class=\"a-list-item\">Cross-device compatibility: HomeKit compatible iOS 9 or later. iPhone:4, 4S, 5, 5S, 6, 6 Plus, 7, iPhone 7 Plus, iPhone 8, iPhone 8 Plus, iPhone X, iPhone Xs, iPhone Xs Max, iPhone Xr, iPod touch: 5th generation.Network Connectivity:Wireless A,Wireless B,Wireless G,Wireless N</span></li>\r\n<li><span class=\"a-list-item\">Easily expand your lighting system with accessories (sold separately), such as a Hue Dimmer Switch, Hue Tap, or Hue Motion Sensor. Pair it for automation with your existing Nest or SmartThings system.</span></li>\r\n</ul>', '1', '[\"featured\",\"trending\",null]', 1, 'deals', NULL, '13', '1', '2022-08-25 14:23:00', '2022-09-30 14:23:00', '52.27', '59.99', '2022-08-25 09:26:54', '2022-09-02 05:53:28');
