(26, 'Fitbit Versa 3 At An Amazing Discount/Deal', 'fitbit-versa-3-health-fitness-at-an-amazing-discount', 'https://www.amazon.com/Fitbit-Fitness-Smartwatch-Battery-Included/dp/B08DFPV5Y2?&linkCode=ll1&tag=hamzahm0e-20&linkId=f05a34c4215832ca434210f6fcb20b1e&language=en_US&ref_=as_li_ss_tl', '226', '25', '<h1 id=\"title\" class=\"a-size-large a-spacing-none\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\">Fitbit Versa 3 Health &amp; Fitness Smartwatch with GPS, 24/7 Heart Rate, Alexa Built-in, 6+ Days Battery, Black/Black, One Size (S &amp; L Bands Included)</span></h1>', '<table class=\"a-normal a-spacing-micro\" style=\"font-size: 14px;\">\r\n<tbody>\r\n<tr class=\"a-spacing-small po-model_name\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Model Name</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Versa 3 Black</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-brand\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Brand</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Fitbit</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-item_shape\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Shape</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Square</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-color\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Color</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Black/Black</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-display.size\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Screen Size</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">1.58 Inches</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-style\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Style</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Modern</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-age_range_description\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Age Range (Description)</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Adult</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-special_feature\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Special Feature</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Time Display, Alarm Clock</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-compatible_devices\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Compatible Devices</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Smartphone</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-band.material\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Band Material Type</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Silicone</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n<li><span class=\"a-list-item\">Receive a Daily Readiness Score that reveals if you&rsquo;re ready to exercise or should focus on recovery (requires Fitbit Premium membership. Premium content recommendations are not available in all locales and may be in English only)</span></li>\r\n<li><span class=\"a-list-item\">Run, bike, hike and more phone-free&mdash;and see your real-time pace &amp; distance&mdash;with built-in GPS. Then check out your workout intensity map in the Fitbit app</span></li>\r\n<li><span class=\"a-list-item\">Active Zone Minutes uses your resting heart rate to gauge exercise effort and gives you a buzz when you step up the intensity so you can make the most of your workouts. Fitbit Versa 3 is water resistant to 50 meters</span></li>\r\n<li><span class=\"a-list-item\">Better track heart rate 24/7 with PurePulse 2.0, Fitbit&rsquo;s enhanced heart rate technology</span></li>\r\n<li><span class=\"a-list-item\">Use Google Assistant or Amazon Alexa Built-in to get quick news, set bedtime reminders and alarms, control your smart home devices and more just by speaking to your watch</span></li>\r\n<li><span class=\"a-list-item\">6-month Fitbit Premium trial for new Premium users (Valid payment method required. Cancel before free trial ends to avoid subscription fees. New Premium users only. Content and features may vary by language and are subject to change.)</span></li>\r\n<li><span class=\"a-list-item\">Get 6+ days of battery on a full charge plus one day of battery in just 12 minutes with fast charging (Battery life varies with use and other factors; up to 12 hours with continuous GPS)</span></li>\r\n</ul>\r\n<div class=\"a-row a-expander-container a-expander-inline-container\">\r\n<div class=\"a-expander-content a-expander-extend-content a-expander-content-expanded\" aria-expanded=\"true\">\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Track your time in light, deep and REM sleep, then receive your Sleep Score to better understand your sleep quality each night</span></li>\r\n<li><span class=\"a-list-item\">Store and play music &amp; podcasts on Deezer or Pandora, plus control Spotify&mdash;all from your wrist. Subscriptions required for use of music services; not available in all countries</span></li>\r\n</ul>\r\n</div>\r\n</div>', '1', '[null,\"trending\",null]', 1, 'deals', NULL, '32', '1', '2022-08-30 10:19:00', '2022-10-31 10:19:00', '157.50', '229.95', '2022-08-30 05:25:53', '2022-10-04 12:03:07'),
