(35, 'Certified Refurbished Echo (4th Gen) SMART HOME 33 % off Limited Time Offer', 'certified-refurbished-echo-4th-gen-smart-home-33-off-limited-time-offer', 'https://amzn.to/3d3KC5h', '226', '9', '<p>Buy Echo ( 4th Gen) Amazing offer by Amazon at 33 % off for limited time period only.&nbsp;</p>', '<h1 id=\"title\" class=\"a-size-large a-spacing-none\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\">Certified Refurbished Echo (4th Gen) | With premium sound, smart home hub, and Alexa | Charcoal</span></h1>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n<li><span class=\"a-list-item\">&nbsp;Certified Refurbished Echo (4th Generation) is refurbished, tested, and certified to look and work like new and comes with the same limited warranty as a new device.</span></li>\r\n<li><span class=\"a-list-item\">New look, new sound - Echo delivers clear highs, dynamic mids, and deep bass for rich, detailed sound that automatically adapts to any room.</span></li>\r\n<li><span class=\"a-list-item\">Voice control your entertainment - Stream songs from Amazon Music, Apple Music, Spotify, SiriusXM, and more. Plus listen to radio stations, podcasts, and Audible audiobooks.</span></li>\r\n<li><span class=\"a-list-item\">Ready to help - Ask Alexa to play music, answer questions, play the news, check the weather, set alarms, control compatible smart home devices, and more.</span></li>\r\n<li><span class=\"a-list-item\">Smart home made simple - With the built-in hub, easily set up compatible Zigbee devices or select Ring Smart Lighting solar lights and bulbs to voice control lights, locks, and sensors.</span></li>\r\n<li><span class=\"a-list-item\">Fill your home with sound - With multi-room music, play synchronized music across Echo devices in different rooms. Or pair your Echo with compatible Fire TV devices to feel scenes come to life with home theater audio.</span></li>\r\n<li><span class=\"a-list-item\">Connect with others - Call almost anyone hands-free. Instantly drop in on other rooms or announce to the whole house that dinner\'s ready.</span></li>\r\n<li><span class=\"a-list-item\">Designed to protect your privacy &ndash; Amazon is not in the business of selling your personal information to others. Built with multiple layers of privacy controls including a mic off button.</span></li>\r\n</ul>', '1', '[null,\"trending\",null]', 1, 'deals', NULL, '34', '1', '2022-09-09 11:00:00', '2022-11-09 11:00:00', '59.99', '89.99', '2022-09-09 06:04:47', '2022-09-09 06:04:47'),
