logs are not only the most comfortable shoes for women and men but also easy to clean just using soap and water and allowing for a quick dry</span></li>\r\n</ul>\r\n</div>\r\n</div>', '1', '[\"featured\",null,null]', 1, 'deals', NULL, '31', '1', '2022-09-09 11:10:00', '2022-11-09 11:10:00', '34.99', '49.99', '2022-09-09 06:17:11', '2022-09-09 06:17:11'),
