(49, 'Eye Repair Cream for Dark Circles, Puffiness & Wrinkles', 'eye-repair-cream-for-dark-circles-puffiness-wrinkles', 'https://www.amazon.com/CeraVe-Repair-Cream-Circles-Puffiness/dp/B00JJPMXDO?qid=1664861844&refinements=p_72%3A1248873011&rnid=1248871011&s=beauty&sbo=RZvfv%2F%2FHxDF%2BO5021pAnSA%3D%3D&sr=1-34&linkCode=ll1&tag=hamzahm0e-20&linkId=0dc492d952bbe1393280b3648a', '226', '21', '<p><em>CeraVe Eye Repair Cream</em>&nbsp;is an eye cream suitable for all skins, including atopic, that helps to reduce eye puffiness and dark circles.</p>', '<h1 id=\"title\" class=\"a-size-large a-spacing-none\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\">Under Eye Cream for Dark Circles and Puffiness | Suitable for Delicate Skin Under Eye Area | 0.5 Ounce</span></h1>\r\n<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n<li><span class=\"a-list-item\">[ UNDER EYE CREAM ] Helps reduce the appearance of dark circles and puffiness in the under eye area. Brightening cream with a non-greasy finish that leaves under eyes looking hydrated, smooth, brightened, and more awake.</span></li>\r\n<li><span class=\"a-list-item\">[ HYDRATING INGREDIENTS ] Formulated with Hyaluronic Acid to help retain skin\'s moisture and Niacinamide to help soothe skin. With CeraVe\'s patented MVE ingredient-delivery technology to continually release ingredients and provide lasting hydration.</span></li>\r\n<li><span class=\"a-list-item\">[ LIGHTWEIGHT TEXTURE ] Apply pea-sized amount to ring fingers and gently pat around the eye area and brow bone, both AM and PM. Fast-absorbing formula can be worn alone or under makeup.</span></li>\r\n<li><span class=\"a-list-item\">[ 3 ESSENTIAL CERAMIDES ] Ceramides are found naturally in the skin and make up 50% of the lipids in the skin barrier. All CeraVe products are formulated with three essential ceramides (1, 3, 6-II) to help restore and maintain the skin&rsquo;s natural barrier</span></li>\r\n<li><span class=\"a-list-item\">[ DERMATOLOGIST RECOMMENDED &amp; OPHTHALMOLOGIST TESTED ] Tested for use around the eye area &amp; accepted by the National Eczema Association. CeraVe brand is developed with dermatologists &amp; has products suitable for dry skin, oily skin, acne-prone, &amp; more</span></li>\r\n<li><span class=\"a-list-item\">[NOTE] This item doesn&rsquo;t have an expiry date</span></li>\r\n</ul>', '1', '[null,\"trending\",null]', 1, 'deals', NULL, '14', '1', '2022-10-04 10:41:00', '2022-12-27 10:41:00', '12.97', '14.99', '2022-10-04 05:45:20', '2022-10-04 05:45:20'),
(50, 'Crunchy Roasted Edamame Beans Vegan Snack', 'crunchy-roasted-edamame-beans-vegan-snack', 'https://www.amazon.com/Only-Bean-Crunchy-Roasted-Edamame/dp/B0B2N5GHMG?keywords=vegan+snacks&qid=1664862674&qu=eyJxc2MiOiI4LjUwIiwicXNhIjoiOC44OSIsInFzcCI6IjguNjQifQ%3D%3D&refinements=p_72%3A1248897011&rnid=1248895011&s=grocery&sbo=RZvfv%2F%2FHxDF%2BO5021', '226', '27', '<div id=\"title_feature_div\" class=\"celwidget\" data-feature-name=\"title\" data-csa-c-type=\"widget\" data-csa-c-content-id=\"title\" data-csa-c-slot-id=\"title_feature_div\" data-csa-c-asin=\"B0B2N5GHMG\" data-csa-c-is-in-initial-active-row=\"false\" data-csa-c-id=\"qbihex-vnbsig-qqjbfe-y2ce6o\" data-cel-widget=\"title_feature_div\">\r\n<div id=\"titleSection\" class=\"a-section a-spacing-none\">\r\n<h1 id=\"title\" class=\"a-size-large a-spacing-none\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\">The Only Bean Crunchy Roasted Edamame - Healthy Snacks for Adults and Kids (Variety Pack), Low Calorie &amp; Carb Keto Snack Food, Vegan Gluten Free High Protein Snacks (11g), Office Snack, 0.9oz 24 pack</span><span id=\"titleEDPPlaceHolder\"></span></h1>\r\n</div>\r\n</div>\r\n<div id=\"bylineInfo_feature_div\" class=\"celwidget\" data-feature-name=\"bylineInfo\" data-csa-c-type=\"widget\" data-csa-c-content-id=\"bylineInfo\" data-csa-c-slot-id=\"bylineInfo_feature_div\" data-csa-c-asin=\"B0B2N5GHMG\" data-csa-c-is-in-initial-active-row=\"false\" data-csa-c-id=\"1eix1c-1du41k-oa9bo2-wy17sj\" data-cel-widget=\"bylineInfo_feature_div\">&nbsp;</div>', '<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n<li><span class=\"a-list-item\">HEALTHY SNACKING MADE EASY: You can enjoy these fun crunchy salty snacks guilt-free knowing that these non-GMO Certified Heart Healthy snacks have zero cholesterol, low glycemic index, a great source of fiber, and an overall great diet snack</span></li>\r\n<li><span class=\"a-list-item\">CONVENIENT: Each 100 calorie snack pack is an individually wrapped snack making it perfect on-the-go, for a kids school lunch snack, and a great bulk office snack with its included convenient display box -- it\'s even a great vending machine snack!</span></li>\r\n<li><span class=\"a-list-item\">HIGH PROTEIN SUPERSNACK: Trying to get your protein chips fix? This protien snack with 11g of complete plant-based protein per serving keeps you on track while feeling great</span></li>\r\n<li><span class=\"a-list-item\">LOW-CARB &amp; KETO FRIENDLY: Enjoy the whole snack bag at once! With only up to 3g of net carbs per serving, our edamame dry roasted, a guilt-free keto friendly food -- a perfect bariatric and diabetic snack</span></li>\r\n<li><span class=\"a-list-item\">CRUNCHY, DELICIOUS, and FUN: Our beans are dry roasted, never-fried, and seasoned to perfection for a satisfying, savory, CRUNCH on every bite! Enjoy it straight from the bag, as a salad topper for extra crunch, or on top of your meal for added fuel!</span></li>\r\n</ul>', '1', '[\"featured\",null,\"hot\"]', 1, 'coupon', 'Tick Save $4 on Amazon', '14', '1', '2022-10-04 11:01:00', '2022-12-31 11:01:00', '24.97', '28.97', '2022-10-04 06:03:44', '2022-10-04 06:03:44');
