(51, 'Larabar Chocolate Chip Brownie, Gluten Free Vegan Fruit & Nut Bar', 'larabar-chocolate-chip-brownie-gluten-free-vegan-fruit-nut-bar', 'https://www.amazon.com/dp/B003XFWNEK?ie=UTF8&psc=1&s=grocery&sp_csd=d2lkZ2V0TmFtZT1zcF9kZXRhaWw&linkCode=ll1&tag=hamzahm0e-20&linkId=b1bbf0094a1603724166d0b1615d4965&language=en_US&ref_=as_li_ss_tl', '226', '27', '<h1 id=\"title\" class=\"a-size-large a-spacing-none\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\">Larabar Chocolate Chip Brownie, Gluten Free Vegan Fruit &amp; Nut Bars, 16 ct</span></h1>\r\n<p><em>Larabar Chocolate Chip Brownie</em>&nbsp;is made from just 6 simple ingredients: dates,&nbsp;<em>chocolate chips</em>, almonds, walnuts, cocoa powder&nbsp;<em>and</em>&nbsp;sea salt&nbsp;<em>and</em>&nbsp;is&nbsp;<em>Vegan</em></p>', '<p><a class=\"a-expander-header a-declarative a-expander-section-header a-color-base-background a-link-section-expander a-size-medium\" role=\"button\" data-csa-c-func-deps=\"aui-da-a-expander-toggle\" data-csa-c-type=\"widget\" data-csa-interaction-events=\"click\" aria-expanded=\"true\" data-action=\"a-expander-toggle\" data-a-expander-toggle=\"{&quot;allowLinkDefault&quot;:true, &quot;expand_prompt&quot;:&quot;&quot;, &quot;collapse_prompt&quot;:&quot;&quot;}\" data-csa-c-id=\"ns5c2a-88iw1f-v86bv4-g8tfov\"><span class=\"a-expander-prompt\"><span class=\"a-size-medium a-text-bold\">Ingredients</span></span></a></p>\r\n<div class=\"a-expander-content a-expander-section-content a-section-expander-inner a-expander-content-expanded\" aria-expanded=\"true\">\r\n<div id=\"nic-ingredients-content\" class=\"a-section a-spacing-none a-spacing-top-small\"><span class=\"a-size-base\">DATES, SEMISWEET CHOCOLATE CHIPS* (UNSWEETENED CHOCOLATE, SUGAR, COCOA BUTTER, VANILLA), ALMONDS, WALNUTS, COCOA POWDER*, SEA SALT.</span></div>\r\n<div class=\"a-section a-spacing-none a-spacing-top-small\">&nbsp;</div>\r\n<div class=\"a-section a-spacing-none a-spacing-top-small\"><span cla