-span3\"><span class=\"a-size-base a-text-bold\">Allergen Information</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Almonds, Walnut</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div id=\"feature-bullets\" class=\"a-section a-spacing-medium a-spacing-top-small\"><hr />\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n<li><span class=\"a-list-item\">HEALTHY SNACKING: With 100% real ingredients and no artificial sweeteners, you can Raise A Bar to what you love! Larabar makes simple healthy snacks you can feel good about eating</span></li>\r\n<li><span class=\"a-list-item\">MADE FROM 6 SIMPLE INGREDIENTS: Larabar Chocolate Chip Brownie is made from just 6 simple ingredients: dates, chocolate chips, almonds, walnuts, cocoa powder and sea salt</span></li>\r\n<li><span class=\"a-list-item\">PLANT BASED CLEAN EATING MADE SIMPLE: Vegan, Gluten Free, Dairy Free, Kosher, Non-GMO, and a Good Source of Fiber</span></li>\r\n<li><span class=\"a-list-item\">HEALTHY INDULGENCE: Conveniently wrapped and great for packing on the go, Larabar is perfect for anything from a morning treat to an afternoon snack</span></li>\r\n<li><span class=\"a-list-item\">CONTAINS: 1.6 oz Bars, 16 ct</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '1', '[\"featured\",null,null]', 1, 'deals', NULL, '12', '1', '2022-10-04 11:10:00', '2022-12-31 11:10:00', '22.24', '24.99', '2022-10-04 06:13:20', '2022-10-04 06:13:20'),
