t well soon care packages, office break rooms or remote workers, virtual meetings, road trips, college dorms, colleague and client appreciation gifts and more! Great for expectant parents as a pregnancy gift, holidays, birthdays and housewarming gifts too! This Vegan Care Package is a great alternative to gift baskets.</span></li>\r\n<li><span class=\"a-list-item\">BEAUTIFULLY PACKAGED: Expertly packed with care in The Good Grocer gift box, this collection of premium certified vegan snacks is sure to impress anyone. No filler, just amazing snacks!</span></li>\r\n<li><span class=\"a-list-item\">GUARANTEED FRESH: Each box is clearly marked with the earliest expiration date. We guarantee our snacks will be fresh when you receive them.</span></li>\r\n<li><span class=\"a-list-item\">SHIPS FAST! Send directly using Amazon Prime with no need for additional gift wrapping or packaging! ... Click \'Add to Cart\' to treat yourself or someone special to this memorable gift! To include gift message select \"gift\" at checkout.</span></li>\r\n</ul>\r\n</div>\r\n</div>', '1', '[null,\"trending\",null]', 1, 'coupon', 'Tick Save $5 Box on Amazon', '8', '1', '2022-10-04 11:39:00', '2022-11-30 11:40:00', '59.95', '64.95', '2022-10-04 06:42:49', '2022-10-04 06:42:49'),
(53, 'Anti-Aging Skincare for Wrinkles and Fine Lines | CeraVe', 'anti-aging-skincare-for-wrinkles-and-fine-lines-cerave', 'https://www.amazon.com/CeraVe-Retinol-Smoothing-Brightening-Fragrance/dp/B07XJ7XWLW?_encoding=UTF8&adgrpid=87176368211&gclid=EAIaIQobChMIiJWBo7_G-gIVxo9oCR0G-AEgEAAYASAAEgKOhvD_BwE&hvadid=585412620178&hvdev=c&hvlocphy=1011081&hvnetw=g&hvqmt=b&hvrand=16315', '226', '21', '<h1 id=\"title\" class=\"a-size-large a-spacing-none\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\">CeraVe Anti Aging Retinol Serum | Cream Serum for Smoothing Fine Lines and Skin Brightening | With Retinol, Hyaluronic Acid, Niacinamide, and Ceramides | 1 Ounce</span></h1>', '<div id=\"productOverview_feature_div\" class=\"celwidget\" data-feature-name=\"productOverview\" data-csa-c-type=\"widget\" data-csa-c-content-id=\"productOverview\" data-csa-c-slot-id=\"productOverview_feature_div\" data-csa-c-asin=\"B07XJ7XWLW\" data-csa-c-is-in-initial-active-row=\"false\" data-csa-c-id=\"k21dsi-mj8rer-y4ogqu-el32v1\" data-cel-widget=\"productOverview_feature_div\">\r\n<div class=\"a-section a-spacing-small a-spacing-top-small\">\r\n<table class=\"a-normal a-spacing-micro\">\r\n<tbody>\r\n<tr class=\"a-spacing-small po-skin_type\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Skin Type</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">All</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-product_benefit\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Product Benefits</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Anti-aging</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-target_use_body_part\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Use for</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Face</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-scent\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Scent</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">unscented</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-special_ingredients\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Special Ingredients</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Encapsulated Retinol, Hyaluronic Acid, Niacinamide, Ceramides</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div id=\"featurebullets_feature_div\" class=\"celwidget\" data-feature-name=\"featurebullets\" data-csa-c-type=\"widget\" data-csa-c-content-id=\"featurebullets\" data-csa-c-slot-id=\"featurebullets_feature_div\" data-csa-c-asin=\"B07XJ7XWLW\" data-csa-c-is-in-initial-active-row=\"false\" data-csa-c-id=\"th28qc-jduhpy-5xr0xi-x196sw\" data-cel-widget=\"featurebullets_feature_div\">\r\n<div id=\"feature-bullets\" class=\"a-section a-spacing-medium a-spacing-top-small\"><hr />\r\n<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n<li><span class=\"a-list-item\">[ RETINOL SERUM FOR FACE ] Anti-aging facial serum with Retinol to help improve skin&rsquo;s texture including visible signs of aging for more radiant skin and Hyaluronic Acid to help retain skin&rsquo;s natural moisture, and Niacinamide to help calm skin.</span></li>\r\n<li><span class=\"a-list-item\">[ SMOOTH TEXTURE ] Lightweight serum with a gel texture and a non-greasy feel. If layering with an eye cream or facial moisturizer, apply Skin Renew Retinol Serum in a thin layer and allow to fully absorb into skin before applying additional products.</span></li>\r\n<li><span class=\"a-list-item\">[ 3 ESSENTIAL CERAMIDES ] Ceramides make up 50% of the lipids in the skin barrier. As you age, studies show that ceramide levels decrease. CeraVe products are formulated with 3 essential ceramides (1,3,6-II) to help restore and maintain the skin barrier.</span></li>\r\n<li><span class=\"a-list-item\">[ DERMATOLOGIST RECOMMENDED ] CeraVe Skincare is developed with dermatologists and has products suitable for dry skin, sensitive skin, oily skin, acne-prone, and more.</span></li>\r\n<li><span class=\"a-list-item\">[ GENTLE ON SKIN ] Fragrance free, non-comedogenic, and non-irritating formula. As retinol can cause sun sensitivity, please apply Skin Renewing Retinol Serum at night or wear a facial moisturizer with at least SPF 30 sunscreen if wearing during the day.</span></li>\r\n</ul>\r\n</div>\r\n</div>', '1', '[\"featured\",null,null]', 1, 'deals', NULL, '11', '1', '2022-10-04 16:45:00', '2022-12-31 16:45:00', '18.79', '20.99', '2022-10-04 11:48:18', '2022-10-04 11:48:18'),
