(6, '0', 'I am a highly organised, results-orientated junior recruitment consultant with four years\' experience working in recruitment and management consultancy environments. I am adept at working under high pressure, where attention to detail, clear communication and organisation are paramount. My capacity to multi-task and take on additional responsibilities has been recognised in both of my roles to date. I am now looking for a challenging new position where my skills and experience can be fully utilised and further enhanced.', '2022-11-18 14:09:37', '2022-11-22 06:13:53'),
(7, '1', 'A Professional Corporate PA and HR Administrator with a wealth of skills and diversified experience in providing an excellent level of support to all levels of senior management. Offering versatile ability to adapt to various corporate and cultural milieus as well as intellectually curious. Approachable, tenacious, bright and personable who remains calm under pressure as well as a level-headed team player', '2022-11-18 14:09:37', '2022-11-20 14:02:18'),
(8, '1', 'A caring, friendly and sensitive individual who has much experience of working as part of a team, and who is dedicated to making a real difference to a person\'s life. I always ensure a patient orientated approach in the delivery of any care I am involved in, and am fully committed to client\'s under my supervision. I greatly enjoy the relationship building aspect of the job, in particular forming bonds with service users and thereby learning how to care for them better and be more attentive to their specific needs. I am currently looking for a suitable position with a company that is seeking to employ exceptional and talented people', '2022-11-18 14:09:37', '2022-11-18 14:09:37'),
(9, '1', 'Efficient and reliable CNC Machinist with over three years of experience who will manufacture fixtures, jigs and miscellaneous tooling in a timely manner and assist engineers with tooling design and manufacturability as needed. This includes repairing of manufacturing tooling and equipment as needed.', '2022-11-18 14:09:37', '2022-11-18 14:09:37'),
(11, '1', 'I am a hard working retail sales assistant with excellent communication skills with a proven background in customer services. I like the buzz of working in retail and especially when it is a busy sale period. I enjoy working to targets and thrive on the challenges that I have working in a retail environment. I have experience in store merchandising and dealing with stock and deliveries as well as sending out orders. I am neat and organized and work in a quick, efficient yet methodical manner. I enjoy working as part of a team environment and ensure that the store I work in meets and exceeds its targets.', '2022-11-18 14:09:37', '2022-11-18 14:09:37'),
(12, '1', 'I am an articulate, confident person who relishes challenges and working under pressure. My greatest strengths are my research, communication and writing skills. Over the past seven years, more than 200 of my articles and publications have been published by leading newspapers and magazines.', '2022-11-18 14:09:37', '2022-11-18 14:09:37'),
